import React, { Component } from 'react';
import './App.css';

class App extends Component {

  clickHandler = (e) => {
    e.preventDefault()
    console.log(e.target.dataset)
  }

  render() {
    return (
      <div>
          <header className="header">
            <nav className="nav-primary">
                <ul>
                  <li className="nav-links"><a href="register" data-value="register" onClick={this.clickHandler}>Register</a></li>
                  <li className="nav-links"><a href="login" onClick={this.clickHandler}>Login</a></li>
                </ul>
            </nav>
            <h1 className="App-Name">SCANAPE</h1>
            <h5 className="App-Sub-Name">You Know The Deal Just Scan And You've Got A Meal</h5>
          </header>
      </div>
    );
  }
}

export default App;
